    /**
     * 内容
     * 关键字
     * 颜色
     */
    lightHigh(content, pwd, color) {
      //match match() 方法可在字符串内检索指定的值，或找到一个或多个正则表达式的匹配。该方法类似 indexOf() 和 lastIndexOf()，但是它返回指定的值，而不是字符串的位置。
      //new Set 把关键字在整个内容里进行对筛选
      let resArr = [...new Set(content.match(pwd))];
      //把筛选出来的关键字遍历
      resArr.forEach((item) => {
        //全局搜索关键字
        let reg = new RegExp(item, "g");
        content = content.replace(
          reg,
          `<span style="background:${color}">` + item + "</span>"
        );
      });
      return content;
    },

  },
};
</script>

